	add("genderist", "{\"term\":\"genderist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|gender|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who discriminates based on gender\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Bruce E. Kaufman, ‎Richard A. Beaumont, ‎Roy B. Helfgott, \u0027Industrial Relations to Human Resources and Beyond\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Although some opponents of Affirmative Action may be aversive racists/\u0027\u0027genderists\u0027\u0027, many others believe that it is morally wrong to consider at all a person\u0027s ethnicity or gender in decision making\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who studies gender\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Julie Ballantyne, ‎Brydie-Leigh Bartleet, \u0027Navigating Music and Sound Education\u0027 (page 80\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"So while critical \u0027\u0027genderists\u0027\u0027 avoid the labels of masculinities and feminist writing, queer theory provides an opportunity for research into gendered practices in music to be viewed through multiple and often contradictory lenses\", \"priority\":6}]}, \"synonyms\":{}}");

	add("genderlessness", "{\"term\":\"genderlessness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|genderless|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being genderless; lack of gender\", \"priority\":1}]}, \"synonyms\":{}}");

	add("genderplay", "{\"term\":\"genderplay\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|gender|play|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Transgression against traditional gender roles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Stan Hawkins, \u0027The British Pop Dandy: Masculinity, Popular Music and Culture\u0027 (page 85\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Given the pop star\u0027s tendency towards self-aestheticization, I think there is an argument to be made for \u0027\u0027genderplay\u0027\u0027 and its close interconnection with homosociality as a performative strategy\", \"priority\":3}]}, \"synonyms\":{}}");

	add("genderswap", "{\"term\":\"genderswap\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|gender|swap|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of changing a fictional character\u0027s biological sex and/or gender identity from the canonical norm\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Emily Turner, \u0026quot;Scary Just Got Sexy: Transgression in \u0027Supernatural\u0027 and Its Fanfiction\u0026quot;, in \u0027In the Hunt: Unauthorized Essays on \u0027Supernatural (ed. Supernatural.tv), BenBella Books (2009), ISBN 9781933771632, [http://books.google.com/books?id\u003dbhxdnszFWL4C\u0026amp;pg\u003dPA162\u0026amp;dq\u003d%22genderswap%22 page 162\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"More sober challenges to the representation of gender in mainstream media (and of course, \u0027Supernatural\u0027 specifically) occur in \u0027\u0027genderswap\u0027\u0027 stories where the sudden change of anatomy is one that throws the character\u0027s world into chaos\", \"priority\":3}]}, \"synonyms\":{}}");

	add("genderswapping", "{\"term\":\"genderswapping\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice or act of assuming a different sex and/or gender identity than one\u0027s actual sex and/or gender identity, especially in a virtual setting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Jamie Fowlie, \u0026quot;alt.eng.disc.clean.sex: discourse@online_bodi.es\u0026quot;, in \u0027Culture and Power: Challenging Discourses\u0027 (ed. M. José Coperías Aguilar), Servei de Publicacions - Universitat de València, ISBN 9788437044293, [http://books.google.com/books?id\u003dOYHSFgt9AmgC\u0026amp;pg\u003dPA102\u0026amp;dq\u003d%22genderswapping%22 page 102\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Unlike the Chat rooms which are rampant with \u0027\u0027genderswapping\u0027\u0027 (usually unconvincingly so) brief encounters, the MOO is both a world and a more or less stable community\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Pamela Church Gibson, \u0026quot;\u0027You\u0027ve Been in My life So Long I Can\u0027t Remember Anything Else:\u0027 Into the Labyrinth with Ripley and the Alien\u0026quot;, in \u0027Keyframes: Popular Cinema and Cultural Studies\u0027 (eds. Matthew Tinkcom \u0026amp; Amy Villarejo), Routledge (2001), ISBN 0415202825, [http://books.google.com/books?id\u003dlv98NgTZkxcC\u0026amp;pg\u003dPA45\u0026amp;dq\u003d%22genderswapping%22 page 45\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Genderswapping\u0027\u0027 on the internet is not, of course, any solution. But Brooker might at least consider its existence, potential, and scope, rather than attributing gender where it is not possible so to do (Brooker 1999: 49\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Earnest Cavalli, \u0026quot;[http://www.wired.com/gamelife/2008/03/majority-of-mmo/ Majority Of MMO Gamers Cross Gender Barrier]\u0026quot;, \u0027Wired\u0027, 4 March 2008\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Despite these issues, the researchers feel their findings should pave the way for further research, particularly whether \u0027\u0027genderswapping\u0027\u0027 in an online setting has a propensity for affecting a player’s gender identity in the real world\", \"priority\":7}]}, \"synonyms\":{}}");

	add("genealogist", "{\"term\":\"genealogist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|genealogy|ist|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who studies, professes or practices genealogy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("generalisation", "{\"term\":\"generalisation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The formulation of general concepts from specific instances by abstracting common properties\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Inductive reasoning from detailed facts to general principles\", \"priority\":2}]}, \"synonyms\":{}}");

