	add("generation", "{\"term\":\"generation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|generacioun}}, Middle french (ca. 1400-1600) {{m|frm|generacion}}, and their source, Latin {{m|la|generātiō}}, from {{m|la|generāre}}, present active infinitive of {{m|la|generō||to beget, generate}}. Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact of creating something, or bringing something into being; production, creation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1832\u0027\u0027, \u0027Principles of Geology\u0027, II\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027generation\u0027\u0027 of peat, when not completely under water, is confined to moist situations\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of creating a living creature or organism; procreation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027The Faerie Queene\u0027, IV.10\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"So all things else, that nourish vitall blood, / Soone as with fury thou doest them inspire, / In \u0027\u0027generation\u0027\u0027 seek to quench their inward fire\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1626\u0027\u0027, \u0027Sylva Sylvarum\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Generation\u0027\u0027 by Copulation (certainly) extendeth not to Plants\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Race, family; breed\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"c. 1605\u0027\u0027, \u0027Timon of Athens\u0027, First Folio 1623, I.3\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Thy Mothers of my \u0027\u0027generation\u0027\u0027: what\u0027s she, if I be a Dogge\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A single step or stage in the succession of natural descent; a rank or degree in genealogy, the members of a family from the same parents, considered as a single unit\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"This is the book of the \u0027\u0027generations\u0027\u0027 of Adam - Genesis 5\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Ye shall remain there [in Babylon] many years, and for a long season, namely, seven \u0027\u0027generations\u0027\u0027 - Baruch 6\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"All \u0027\u0027generations\u0027\u0027 and ages of the Christian church - w:Richard Richard Hooke\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Descendants, progeny; offspring\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The average amount of time needed for children to grow up and have children of their own, generally considered to be a period of around thirty years, used as a measure of time\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Edgar Thorpe, \u0027Objective English\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Before the independence of India the books of Dr P. K. Yadav presented a fundamental challenge to the accepted ideas of race relations that, two \u0027\u0027generations\u0027\u0027 later, will be true of the writings of the radical writers of the 1970s\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A set stage in the development of computing or of a specific technology\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Paul Deital, Harvey Deital and Abbey Deital, \u0027iPhone for Programmers\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"The first-\u0027\u0027generation\u0027\u0027 iPhone was released in June 2007 and was an instant blockbuster success\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"The formation or production of any geometrical magnitude, as a line, a surface, a solid, by the motion, in accordance with a mathematical law, of a point or a magnitude; as, the \u0027\u0027generation\u0027\u0027 of a line or curve by the motion of a point, of a surface by a line, a sphere by a semicircle, etc\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"A specific age range in which each person in that range can relate culturally to one another\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Generation X grew up in the eighties, whereas the \u0027\u0027generation\u0027\u0027 known as the millennials grew up in the nineties\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"A version of a form of pop culture which differs from later or earlier versions\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"People sometimes dispute which \u0027\u0027generation\u0027\u0027 of Star Trek is best, including the original and The Next Generation\", \"priority\":27}]}, \"synonyms\":{}}");

	add("generationer", "{\"term\":\"generationer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|generation|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of a specified generation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Bakari Kitwana, \u0027The hip hop generation\u0027 (page 89\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Although Ali was not a hip-hop \u0027\u0027generationer\u0027\u0027, the community-wide debate sparked by her book exposed the crux of the gender issue facing the hip-hop generatio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Robert C. Smith, \u0027Mexican New York: transnational lives of new immigrants\u0027 (page 158\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One Ticuani native in her mid-twenties, who has long- established friendships with returning second-\u0027\u0027generationers\u0027\u0027, is uncomfortable with the contrast between their apparent ease and her own family\u0027s difficult financial situation\", \"priority\":5}]}, \"synonyms\":{}}");

