	add("genetics", "{\"term\":\"genetics\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027γένεσις\u0027 (origin) Ultimately from \u0027γίγνομαι\u0027 (i come into being)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of biology that deals with the transmission and variation of inherited characteristics, in particular chromosomes and DNA\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The genetic makeup of a specific individual or species\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Mark Linden O’Meara, \u0027The Feeling Soul: A Roadmap to Healing and Living\u0027, Soul Care Publishing, ISBN 978-0-9680459-2-3, [http://books.google.com/books?id\u003d3lW_InMEFt4C\u0026amp;pg\u003dPA45\u0026amp;dq\u003dgenetics page 45\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"As a result of your father’s, mother’s, and their parents \u0026lt;!-- [sic] no apostrophe --\u0026gt; \u0027\u0027genetics\u0027\u0027, you are born with a genetic structure that is dealt to you at conception. Our ancestry determines our \u0027\u0027genetics\", \"priority\":4}]}, \"synonyms\":{}}");

	add("geneva", "{\"term\":\"geneva\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"Mentioned in Latin texts as \u0027genava\u0027 Probably via origin from Proto-indo-european root {{m|ine-pro|*genu||bend}}, {{m|ine-pro|*genawa}} in the sense of a bending river or estuary, possibly akin to \u0027genoa\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Gin, especially Holland gin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("genfic", "{\"term\":\"genfic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|gen|fic|lang\u003den}}, \u0027general\u0027 + \u0027fan fiction\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"fan Fan fiction that does not focus specifically on romance or sex\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Will Brooker, \u0027Using the Force: Creativity, Community and Star Wars Fans\u0027, Continuum (2002), ISBN 0826452876, [http://books.google.com/books?id\u003d80kB6JG1PVsC\u0026amp;pg\u003dPA136\u0026amp;dq\u003d%22I+do+read+a+lot+of+genfic%22 page 136\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Fee Folay writes, \u0026quot;I do read a lot of \u0027\u0027genfic\u0027\u0027, but I find the slash is more likely to explore a deeper, more intense relationship between the male protagonists, and that beguiles me.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Steve Abrams and Smaragd Grün, \u0026quot;Mundanes at the Gate … and Perverts Within: Managing Internal and External Threats to Community Online\u0026quot;, in \u0027Electronic Tribes: The Virtual Worlds of Geeks, Gamers, Shamans, and Scammers\u0027 (eds. Tyrone L. Adams \u0026amp; Stephen A. Smith), University of Texas Press (2008), ISBN 9780292717732, [http://books.google.com/books?id\u003ddzajtOOTA0IC\u0026amp;pg\u003dPA210\u0026amp;dq\u003d%22genfic%22 page 210\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Genfic\u0027\u0027 and hetfic typically extend the source material along lines consistent with the producers\u0027 intentions, albeit sometimes more explicitly than the broadcast market would allow\", \"priority\":5}]}, \"synonyms\":{}}");

