	add("genie", "{\"term\":\"genie\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027génie\u0027 (lang\u003dfr) used to translate Arabic \u0027جِنّ\u0027 based on similarity of sound and sense) from Latin \u0027genius\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An invisible spirit mentioned in the Qur\u0027an and believed by Muslims to inhabit the earth and influence mankind by appearing in the form of humans or animals, of pre-Islamic Arabian mythological origin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fictional magical being that is typically bound to obey the commands of a mortal possessing its container\", \"priority\":2}]}, \"synonyms\":{}}");

