	add("genistein", "{\"term\":\"genistein\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An isoflavone, found in clover, soya etc., that has estrogenic properties\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Mepur H. Ravindranath, Sakunthala Muthugounder, Naftali Presser, Subramanian Viswanathan, \u0027Anticancer Theraputic Potential of Soy Isoflavone, \u0027\u0027Genistein\u0027\u0027\u0027, Edwin Lowell Cooper, Nobuo Yamaguchi (editors), \u0027Complementary and Alternative Approaches to Biomedicine\u0027, Advances in Experimental Medicine and Biology, Volume 546, [https://books.google.com.au/books?id\u003drCMYNGmOKygC\u0026amp;pg\u003dPA121\u0026amp;dq\u003d%22genistein%22%7C%22genisteins%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22genistein%22%7C%22genisteins%22\u0026amp;f\u003dfalse page 121\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Genistein\u0027\u0027 (4\u00275, 7-trihydroxyisoflavone) occurs as a glycoside (genistin) in the plant family Leguminosae, which includes the soybean (\u0027Glycine max\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Audrey King Batoon, \u0027Prevention of Genomic Instability by the Dietary Antimutagens \u0027\u0027Genistein\u0027\u0027 and Lycopene\u0027, PhD thesis, [https://books.google.com.au/books?id\u003d_c7PZNiO_GkC\u0026amp;pg\u003dPA163\u0026amp;dq\u003d%22genistein%22%7C%22genisteins%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22genistein%22%7C%22genisteins%22\u0026amp;f\u003dfalse page 163\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Dietarily-relevant, low micromolar concentrations of \u0027\u0027genistein\u0027\u0027 and lycopene were found to be effective mitigators against the genomic instability present in the MCF-7, MDA-MB-468, and BT-474 breast cancer cells\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Y. Wu, H.-D. Chen, Y.-H. Li, X.-H. Gao, V. R. Preedy, \u00275: Antioxidants and skin: an overview\u0027, Victor R. Preedy (editor), \u0027Handbook of Diet, Nutrition and the Skin\u0027, [https://books.google.com.au/books?id\u003dFGlW1NnsZWIC\u0026amp;pg\u003dPA85\u0026amp;dq\u003d%22genistein%22%7C%22genisteins%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22genistein%22%7C%22genisteins%22\u0026amp;f\u003dfalse page 85\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Isoflavones, such as \u0027\u0027genistein\u0027\u0027 and daidzein, are one main group of phytoestrogens\", \"priority\":10}]}, \"synonyms\":{}}");

	add("genitalia", "{\"term\":\"genitalia\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027genitalia\u0027 substantive use of plural of \u0027genitalis\u0027 (pertaining to generation or birth)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"genital or sex organ\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a collection of genitals\", \"priority\":2}]}, \"synonyms\":{}}");

	add("genitality", "{\"term\":\"genitality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In psychoanalytic theory, the part of sexuality that relates to the genitalia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In Reichian psychoanalysis, the integrated function of the entire sexual apparatus; as opposed to pregenitality, neurosis. Note that in this use, sexuality oriented on the genitalia may not by itself constitute genitality, i.e. phallicism would be considered a pregenitally functioning sexuality\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The ability to attain erotic sensation in the genitalia\", \"priority\":3}]}, \"synonyms\":{}}");

	add("genitor", "{\"term\":\"genitor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{PIE root|en|ǵenh₁}}From Latin \u0027genitor\u0027 from \u0027genitus\u0027 past participle of the verb {{m|la|gignō}} + agent noun suffix \u0027-or\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a biological parent (either male or female), or the direct cause of an offspring\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a generator; an originato\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The genitals\", \"priority\":3}]}, \"synonyms\":{}}");

	add("geniture", "{\"term\":\"geniture\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Old (and modern) French géniture, or its source Latin genitura, from the base of gignere ‘beget’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Birth, begetting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1759\u0027\u0027: on \u0027Lady-Day\u0027, which was on the 25th of the same month in which I date my \u0027\u0027geniture\u0027\u0027,—my father set out upon his journey to \u0027London\u0027 with my eldest brother \u0027Bobby\u0027, to fix him at \u0027Westminster\u0027 school — Laurence Sterne, \u0027The Life \u0026amp; Opinions of Tristram Shandy, Gentleman\u0027 (Penguin 2003, p. 10\", \"priority\":2}]}, \"synonyms\":{}}");

	add("genkan", "{\"term\":\"genkan\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\", \"Japanese\", \"late middle chinese\", \"old chinese\"], \"text\":\"From Japanese \u0027玄関\u0027 from Late middle chinese 玄關 (\u0027hwen-kwæn\u0027 \u0026quot;entrance to Buddhist knowledge\u0026quot;, by metaphor \u0026quot;front door\u0027) (compare Mandarin chinese \u0027xuánguān\u0027 玄关), from Old chinese 玄 (\u0027*ɢʷˁin\u0027 \u0026quot;dark\u0026quot;, \u0026quot;profound\u0026quot;) + 關 (\u0027*kˁron\u0027 \u0026quot;barrier\u0026quot;, \u0026quot;gate\u0026quot;).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The entryway to a Japanese house, where street shoes are removed and houseshoes put on before entering the house, and house shoes removed and street shoes put on before leaving the house\", \"priority\":1}]}, \"synonyms\":{}}");

