	add("genocide", "{\"term\":\"genocide\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Coined in 1943 by Polish-Jewish legal scholar {{w|Raphael Lemkin}} (1900–1959) to describe what the Nazis perpetrated against the Jewish people in the Holocaust.\u0026lt;ref\u0026gt;[http://www.ushmm.org/wlc/en/article.php?ModuleId\u003d10007043]\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;Daniel Levy, \u0027The Holocaust and Memory in the Global Age\u0027 (2006, ISBN 1592132766), page 91: \u0026quot;In 1943, Raphael Lemkin, a Polish Jew, coined the term \u0026quot;genocide\u0026quot; for the deliberate extermination of a people. Without a doubt, the Holocaust provided the occasion for Lemkin\u0027s attempts to warn the world of the systematic annihilation of particular groups, {{...}}\u0026quot;\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;Hyde, Jennifer (2 December, 2008). \u0026quot;Polish Jew gave his life defining, fighting genocide\u0026quot;. CNN. http://www.cnn.com/2008/WORLD/europe/11/13/sbm.lemkin.profile/\u0026lt;/ref\u0026gt; From the stem of Ancient greek (to 1453) \u0027γένος\u0027 (race, kind) or Latin {{m|la|gēns||tribe, clan}} (as in \u0027genus\u0027 , {{suffix||cide|t2\u003dkilling, killer|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The systematic killing of substantial numbers of people on the basis of their ethnicity, religion, political beliefs, social status, or other particularities\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Raymond title\u003dNative Americans in the Twentieth isbn\u003d0252012852|passage\u003dNative Americans in the twentieth century are no longer a \u0026quot;vanishing race\u0026quot; or a silent minority. They have survived centuries of cultural \u0027\u0027genocide\u0027\u0027 inflicted on them by non-Native Americans— both the well-meaning and the self-seeking—\", \"priority\":2}]}, \"synonyms\":{}}");

	add("genocider", "{\"term\":\"genocider\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|genocide|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who commits genocide\", \"priority\":1}]}, \"synonyms\":{}}");

	add("genoese", "{\"term\":\"genoese\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Genoa|ese|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An inhabitant or resident of Genoa\", \"priority\":1}]}, \"synonyms\":{}}");

	add("genome", "{\"term\":\"genome\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"From German \u0027genom\u0027 {{suffix|gene|ome|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; The complete genetic information (either DNA or, in some viruses, RNA) of an organism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dCreating a complete map of the human connectome would therefore be a monumental milestone but not the end of the journey to understanding how our brains work. The achievement will transform neuroscience and serve as the starting point for asking questions we could not otherwise have answered, just as having the human \u0027\u0027genome\u0027\u0027 has made it possible to ask new questions about cellular and molecular systems\", \"priority\":2}]}, \"synonyms\":{}}");

