	add("genophobe", "{\"term\":\"genophobe\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|geno|phobe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who has a psychological fear of sexual relations or sexual intercours\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, David Grambs, \u0027Dimboxes, Epopts, and Other Quidams: Words to Describe Life’s Indescribable People\u0027, Workman Publishing Company, [http://books.google.com/books?id\u003dF-_XAAAAMAAJ\u0026amp;dq\u003d%22genophobes%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"search_anchor unmarked page\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Genophobes\u0027\u0027 have been informed about the birds and the bees, but they don’t like (or aren’t cocksure about) what they’ve heard and tend to go catatonic when beyond the platonic\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027 July 16, Gary Goodman, \u0026quot;[https://groups.google.com/d/msg/alt.censorship/1i_Hp1AyjX8/UZEUzHAuOB8J Re: Riefenstahl film on PBS]\u0026quot;, alt.censorship, Usenet\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Like what happens when the \u0027\u0027genophobes\u0027\u0027 try to censor video rental stores. THEN people get outraged. And say fuck off\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027 January 26, Nudiarist, “[https://groups.google.com/d/msg/rec.nude/rVKJ70QH3Jo/hseIh0lC9FkJ Re: Dan Ziegler finally professing what Peter Riden has long been preaching/stating]”, rec.nude, Usenet\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I do think that \u0027\u0027genophobes\u0027\u0027 like \u0026quot;Anna\u0026quot;, and misanthropes like \u0026quot;Zee\u0026quot; are in the minority, zealots who decry any form of sexual expression that is not behind a locked door with the lights out and the covers pulled all the way up\", \"priority\":8}]}, \"synonyms\":{}}");

	add("genopolitics", "{\"term\":\"genopolitics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|geno|politics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the genetic basis of political behaviour and attitudes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("genotype", "{\"term\":\"genotype\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|geno|type|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The combination of alleles, situated on corresponding chromosomes, that determines a specific trait of an individual, such as \u0026quot;Aa\u0026quot; or \u0026quot;aa\u0026quot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A group of organisms having the same genetic constitution\", \"priority\":2}]}, \"synonyms\":{}}");

	add("genre", "{\"term\":\"genre\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|genre|t\u003dkind|lang\u003den}}, from Latin \u0027genus\u0027 (cognate with Ancient Greek \u0027γένος\u0027 , from Proto-indo-european {{m|ine-pro|*genes-}}. Compare \u0027gender\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind; a stylistic category or sort, especially of literature or other artworks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The still-life has been a popular \u0027\u0027genre\u0027\u0027 in painting since the 17th century\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The computer game Half-Life redefined the first-person shooter \u0027\u0027genre\", \"priority\":3}]}, \"synonyms\":{}}");

	add("genro", "{\"term\":\"genro\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Japanese\"], \"text\":\"From Japanese 元老.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A body of elder statesmen of Japan, formerly used as informal advisors to the Emperor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027: That last part was in line with the \u0027\u0027\u0027genro\u0027\u0027\u0027 Prince Saionji\u0027s advice to the Emperor: advice which the Emperor ignored. — Clive James, \u0027Cultural Amnesia\u0027 (Picador 2007, p. 814\", \"priority\":2}]}, \"synonyms\":{}}");

