	add("gentleman", "{\"term\":\"gentleman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{calque|gentle|man|etyl lang\u003dfr|etyl term\u003dgentilhomme|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A well‐mannered or charming man\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A man of breeding or higher class\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|passage\u003dI corralled the judge, and we started off across the fields, in no very mild state of fear of that \u0027\u0027gentleman\u0027\u0027s wife, whose vigilance was seldom relaxed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"As a political system democracy seems to me extraordinarily foolish,. My servant is, so far as I am concerned, welcome to as many votes as he can get.I do not suppose that it matters much in reality whether laws are made by dukes or cornerboys, but I like, as far as possible, to associate with \u0027\u0027gentlemen\u0027\u0027 in private life\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A polite term referring to a man\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003d“[…] This is Mr. Churchill, who, as you are aware, is good enough to come to us for his diaconate, and, as we hope, for much longer; and being a \u0027\u0027gentleman\u0027\u0027 of independent means, he declines to take any payment.” Saying this Walden rubbed his hands together and smiled contentedly\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A polite form of address to a group of men\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Toilets intended for use by men\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A cricketer of independent wealth, who does not (require to) get paid to play the sport\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Amateur\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Mary N. Woods, \u0026quot;The First Professional: Benjamin Henry Latrobe\u0026quot;, in, Keith L. Eggener, editor, \u0027American Architectural History: A Contemporary Reader\u0027, electronic edition, ISBN 0203643682, p.119\u0026amp;nbsp;[http://books.google.com/books?id\u003d-dDKjSIDdksC\u0026amp;pg\u003dPA119\u0026amp;dq\u003dgentleman\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Latrobe had extensive dealings with Jefferson, the most prominent \u0027\u0027gentleman-\u0027\u0027architect in the United States\", \"priority\":12}]}, \"synonyms\":{\"list\":[{\"text\":\"gents\", \"synonymQualifier\":\"COLLOQUIAL\"}]}}");

	add("gentlemanliness", "{\"term\":\"gentlemanliness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|gentlemanly|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"gentlemanly behaviour, of or pertaining to being a gentleman\", \"priority\":1}]}, \"synonyms\":{}}");

