	add("gentlewoman", "{\"term\":\"gentlewoman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman of the nobility\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1623\u0027\u0027, \u0027w:William William Shakespeare\u0027, Macbeth\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Gentlewoman: Since his majesty went into the field, I have seen her rise from her bed, throw her night-gown upon\", \"priority\":3}]}, \"synonyms\":{}}");

	add("gentrice", "{\"term\":\"gentrice\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027genterise\u0027 variant form of \u0027\u0027 from \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being high-born; gentility\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1939\u0027\u0027, Harold W. Thompson, \u0027Body, Boots, \u0026amp; Britches: Folktales, Ballads, and Speech from Country New York\u0027, Syracuse University Press (1979), ISBN 081562218X, [http://books.google.com/books?id\u003d24lOCtZ4o_kC\u0026amp;pg\u003dPA326 page 326\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The tragedy, however, as Burke and other British statesmen were to declare, had already been prepared indirectly by Gentlemen Johnny Burgoyne, whose claims to \u0027\u0027gentrice\u0027\u0027 were as dubious as his talents as a general\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"High-born individuals collectively; gentry\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, w:Richard Barham Richard Middleton, \u0027The Ghost Ship and Other Stories\u0027, Mitchell Kennerley (1913), [http://archive.org/stream/ghostshipandoth00machgoo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"page/n34/ page 16\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I don\u0027t hold with \u0027\u0027gentrice\u0027\u0027 who fetch their drink from London instead of helping local traders to get their living.\u0026quot\", \"priority\":7}]}, \"synonyms\":{}}");

	add("gentrification", "{\"term\":\"gentrification\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of renewal and rebuilding accompanying the influx of middle class or affluent people into deteriorating areas that often displaces earlier usually poorer residents\", \"priority\":1}]}, \"synonyms\":{}}");

	add("gentry", "{\"term\":\"gentry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027genterise\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Birth; condition; rank by birth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Courtesy; civility; complaisance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"People of education and good breeding\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In a restricted sense, those people between the nobility and the yeomanry\", \"priority\":4}]}, \"synonyms\":{}}");

	add("genus", "{\"term\":\"genus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{PIE root|en|ǵenh₁}}Borrowed from Latin \u0027genus|lang\u003dla\u0027 () from the root \u0027gen-\u0027 in Latin \u0027gignere\u0027 Old latin {{m|itc-ola|gegnere||to beget, produce}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a rank in the classification of organisms, below family and above species; a taxon at that ran\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"All magnolias belong to the \u0027\u0027genus\u0027\u0027 \u0027Magnolia\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Other species of the \u0027\u0027genus\u0027\u0027 \u0027Bos\u0027 are often called cattle or wild cattle\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"There are only two \u0027\u0027genera\u0027\u0027 and species of seadragons\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Müller criticized the division of the \u0026quot;Jubuleae\u0026quot; into two families and he cited \u0027Jubula\u0027 as an annectant \u0027\u0027genus\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A group with common attributes\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1945\u0027\u0027, \u0027A History of Western Philosophy\u0027, p. 655\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Recollection is one of a whole \u0027\u0027genus\u0027\u0027 of effects which are more or less peculiar to the phenomena that we naturally call \u0026quot;mental.\u0026quot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A number measuring some aspect of the complexity of any of various manifolds or graph\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Within a definition, a broader category of the defined concept\", \"priority\":10}]}, \"synonyms\":{}}");

	add("genuineness", "{\"term\":\"genuineness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|genuine|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being genuine; authenticity\", \"priority\":1}]}, \"synonyms\":{}}");

